import React from "react";
import "../index.css";
const NotFound = () => {
  return (
    <section className="top-sales">
      <h2 className="text-center">Страница не найдена</h2>
      <p style={{margin: auto}}>Извините, такая страница не найдена!</p>
    </section>
  );
};

export default NotFound;
